    [],nt"revision_timestamp": "2015-09-12T07:50:16.499208",nt"name": "alternative-dispute-resolution-adr-information",nt"isopen":
    true,nt"url": null,nt"notes": "The U.S. Office of Personnel Management
    (OPM) maintains information on disputes settled at OPM through the Equal Employment
    Opportunity (EEO) and/or Alternative Dispute Resolution (ADR, which refers to a
    variety of confidential processes that help parties resolve disputes without litigation).
    Specifically, we maintain information on mediations, informal resolutions and use
    of collaborative law to resolve disputes between OPM employees (former, current
    or applicants for employment) and OPM as an Agency.  The data includes personal
    information such as names and addresses, as well as meeting notes and information
    on the length of the EEO complaints, the organizations involved, and, ultimately,
    how are the complaints and/or mediation resolved.",nt"license_title": "U.S.
